# ========== CORE FUNCTIONS ==========

def clear_database():
    """Clears all database tables in dependency-safe order."""
    print("üßπ Resetting database tables...")
    try:
        inspector = inspect(db.engine)
        existing_tables = inspector.get_table_names()
        
        # Ordered by dependency (child tables first)
        expected_order = [
            'invites', 'reviews', 'summaries', 'meetings',
            'memberships', 'follows', 'bookclubs', 'books', 'users'
        ]
        
        for table in expected_order:
            if table not in existing_tables:
                raise Exception(f"Missing required table: {table}")

        try:
            db.session.execute(text("SET CONSTRAINTS ALL DEFERRED"))
        except Exception:
            pass  # Optional on some DB engines

        for table in expected_order:
            db.session.execute(text(f"TRUNCATE TABLE {table} RESTART IDENTITY CASCADE"))

        db.session.commit()
        return True
    except Exception as e:
        db.session.rollback()
        print("‚ùå Error during database clear:", e)
        traceback.print_exc()
        return False

