# ========== SEEDERS ==========

def seed_users():
    """Seeds users into database."""
    users = generate_users()
    db.session.add_all(users)
    db.session.commit()
    print("‚úÖ Users added.")
    return users

def seed_books():
    """Seeds books into database."""
    books = generate_books()
    db.session.add_all(books)
    db.session.commit()
    print("‚úÖ Books added.")
    return books

def seed_clubs(users):
    """Seeds book clubs into database."""
    clubs = generate_clubs(users)
    db.session.add_all(clubs)
    db.session.commit()
    print("‚úÖ BookClubs added.")
    return clubs

def seed_memberships(users, clubs):
    """Seeds memberships into database."""
    memberships = []
    for user in users:
        for club in random.sample(clubs, min(3, len(clubs))):
            memberships.append(Membership(
                user_id=user.id,
                bookclub_id=club.id,
                joined_at=datetime.now() - timedelta(days=random.randint(1, 30))
            ))
    db.session.add_all(memberships)
    db.session.commit()
    print("‚úÖ Memberships created.")

def seed_summaries(users, books, clubs):
    """Seeds summaries into database."""
    summaries = []
    for i, book in enumerate(books):
        summaries.append(Summary(
            content=f"Summary for {book.title}: A deep dive into its themes of {book.genres[0].lower()} and more.",
            user_id=users[i % len(users)].id,
            book_id=book.id,
            bookclub_id=clubs[i % len(clubs)].id
        ))
    db.session.add_all(summaries)
    db.session.commit()
    print("‚úÖ Summaries added.")

def seed_reviews(users, books):
    """Seeds reviews into database."""
    reviews = []
    for i, book in enumerate(books):
        reviews.append(Review(
            content=f"I found {book.title} to be incredibly {['insightful', 'emotional'][i%2]}.",
            rating=random.randint(3, 5),
            user_id=users[i % len(users)].id,
            book_id=book.id
        ))
    db.session.add_all(reviews)
    db.session.commit()
    print("‚úÖ Reviews added.")

def seed_invites(users, clubs):
    """Seeds invites into database."""
    invites = []
    for i in range(len(users)):
        sender = users[i]
        recipient = users[(i+1) % len(users)]
        club = clubs[i % len(clubs)]
        invites.append(Invite(
            sender_id=sender.id,
            recipient_id=recipient.id,
            bookclub_id=club.id,
            status=random.choice(list(InviteStatus)),
            token=generate_invite_token(sender.id, club.id, recipient.id)
        ))
    db.session.add_all(invites)
    db.session.commit()
    print("‚úÖ Invites created.")

def seed_meetings(clubs):
    """Seeds meetings into database."""
    meetings = []
    for club in clubs:
        meetings.append(Meeting(
            bookclub_id=club.id,
            creator_id=club.owner_id,
            meeting_date=datetime.now() + timedelta(days=random.randint(3, 14)),
            agenda=f"Discuss '{club.current_book['title']}' progress and favorite quotes."
        ))
    db.session.add_all(meetings)
    db.session.commit()
    print("‚úÖ Meetings scheduled.")

def seed_follows(users):
    """Seeds follow relationships into database."""
    follow_data = []
    for i, user in enumerate(users):
        for j in range(1, 3):  # Follow next two users
            followee = users[(i + j) % len(users)]
            follow_data.append({
                'follower_id': user.id,
                'followed_id': followee.id,
                'created_at': datetime.now() - timedelta(days=random.randint(1, 30))
            })
    db.session.execute(follows_table.insert(), follow_data)
    db.session.commit()
    print("‚úÖ Follow relationships established.")

# ========== MAIN FUNCTION ==========

def seed_database():
    """Main function to seed all database tables."""
    app = create_app()
    with app.app_context():
        if not clear_database():
            print("‚ùå Aborting seed due to database reset failure.")
            return

        try:
            print("üå± Starting comprehensive database seeding...")
            
            # Seed core entities
            users = seed_users()
            books = seed_books()
            clubs = seed_clubs(users)
            
            # Seed relationships and content
            seed_memberships(users, clubs)
            seed_summaries(users, books, clubs)
            seed_reviews(users, books)
            seed_invites(users, clubs)
            seed_meetings(clubs)
            seed_follows(users)
            
            print("üéâ Database successfully seeded!")
            print(f"Created: {len(users)} users, {len(books)} books, {len(clubs)} clubs")
            
        except Exception as e:
            db.session.rollback()
            print(f"‚ùå Seeding failed: {e}")
            traceback.print_exc()

if __name__ == "__main__":
    seed_database()